import React, { useState } from 'react';

const Sectors = () => {
  const [modalOpen, setModalOpen] = useState(null);
  const [contentWindowOpen, setContentWindowOpen] = useState(false);

  // Handle opening of the modal for each objective
  const handleModalOpen = (index) => {
    setModalOpen(index);
  };

  // Handle closing the modal
  const handleModalClose = () => {
    setModalOpen(null);
  };

  // Handle opening the content window for additional information
  const handleContentWindowOpen = () => {
    setContentWindowOpen(true);
  };

  // Handle closing the content window
  const handleContentWindowClose = () => {
    setContentWindowOpen(false);
  };

  return (
    <div
      id="sectors"
      style={{
        paddingTop: '5rem',
        paddingBottom: '5rem',
        backgroundImage: 'linear-gradient(to bottom left, #FFF4E6, #FFFFFF, #E4F9D9)',
      }}
    >
      <div style={{ maxWidth: '80rem', margin: '0 auto', paddingLeft: '1rem', paddingRight: '1rem' }}>
        <div style={{ textAlign: 'center', marginBottom: '4rem' }}>
          <h2
            style={{
              fontSize: '1.875rem',
              fontWeight: '700',
              color: '#1F2937',
            }}
          >
            <span
              style={{
                color: '#FB923C',
                fontSize: '2.5rem',
                fontWeight: '700',
              }}
            >
              Our Objectives
            </span>
          </h2>
          <p
            style={{
              marginTop: '1rem',
              fontSize: '1.25rem',
              color: '#4B5563',
            }}
          >
            The objectives of AIFBF are to promote economic growth, enhance financial systems, and equip stakeholders
            with the necessary skills to drive sustainable development and contribute to India's GDP.
          </p>
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))', gap: '2rem' }}>
          {/* Growth */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  style={{
                    height: '3rem',
                    width: '3rem',
                    color: '#FB923C',
                  }}
                >
                  <rect width="20" height="14" x="2" y="7" rx="2" ry="2"></rect>
                  <path d="M16 21V5a2 2 0 0 0-2-2h-4a2 2 0 0 0-2 2v16"></path>
                </svg>
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Growth
              </h3>
              <button
                onClick={() => handleModalOpen(1)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#FB923C',
                  border: '1px solid #FB923C',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>

          {/* Excellence */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <img
                  src="path_to_your_original_excellence_logo"
                  alt="Excellence"
                  style={{
                    height: '3rem',
                    width: '3rem',
                  }}
                />
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Excellence
              </h3>
              <button
                onClick={() => handleModalOpen(2)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#4B5563',
                  border: '1px solid #4B5563',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>

          {/* Impact */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  style={{
                    height: '3rem',
                    width: '3rem',
                    color: '#FB923C',
                  }}
                >
                  <path d="M21 16V8a2 2 0 0 0-1-1.73l-7-4a2 2 0 0 0-2 0l-7 4A2 2 0 0 0 3 8v8a2 2 0 0 0 1 1.73l7 4a2 2 0 0 0 2 0l7-4A2 2 0 0 0 21 16z"></path>
                  <circle cx="12" cy="12" r="4"></circle>
                </svg>
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Impact
              </h3>
              <button
                onClick={() => handleModalOpen(3)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#FB923C',
                  border: '1px solid #FB923C',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>

          {/* Reputation */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <img
                  src="path_to_your_original_reputation_logo"
                  alt="Reputation"
                  style={{
                    height: '3rem',
                    width: '3rem',
                  }}
                />
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Reputation
              </h3>
              <button
                onClick={() => handleModalOpen(4)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#FB923C',
                  border: '1px solid #FB923C',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>
        </div>

        {/* Button to open the content window */}
        <div style={{ textAlign: 'center', marginTop: '3rem' }}>
          <button
            onClick={handleContentWindowOpen}
            style={{
              backgroundColor: '#FB923C',
              color: '#fff',
              padding: '1rem 2rem',
              fontSize: '1.25rem',
              fontWeight: '600',
              border: 'none',
              borderRadius: '0.375rem',
              cursor: 'pointer',
              transition: 'all 0.3s ease',
            }}
          >
            Show Content
          </button>
        </div>

        {/* Content Window */}
        {contentWindowOpen && (
          <div
            style={{
              position: 'fixed',
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              background: 'rgba(0, 0, 0, 0.5)',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              zIndex: 10,
            }}
          >
            <div
              style={{
                background: '#fff',
                padding: '2rem',
                borderRadius: '0.5rem',
                width: '80%',
                maxWidth: '1000px',
              }}
            >
              <div
                style={{
                  display: 'grid',
                  gridTemplateColumns: 'repeat(2, 1fr)', // Adjusted to 2 cards per row
                  gap: '1.5rem',
                }}
              >
                {/* Cards */}
                {[...Array(4)].map((_, index) => (
                  <div
                    key={index}
                    style={{
                      backgroundColor: '#F9FAFB',
                      padding: '1.5rem',
                      borderRadius: '0.5rem',
                      boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                    }}
                  >
                    <h3 style={{ fontSize: '1.25rem', color: '#1F2937', fontWeight: '600' }}>Card {index + 1}</h3>
                    <p style={{ color: '#4B5563' }}>This is some sample content for card {index + 1}.</p>
                  </div>
                ))}
              </div>

              {/* Close Button */}
              <button
                onClick={handleContentWindowClose}
                style={{
                  marginTop: '2rem',
                  padding: '1rem 2rem',
                  backgroundColor: '#FB923C',
                  color: '#fff',
                  fontSize: '1rem',
                  border: 'none',
                  borderRadius: '0.375rem',
                  cursor: 'pointer',
                  transition: 'all 0.3s ease',
                }}
              >
                Close
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Sectors;
